import { useLocation } from 'react-router';

function Order() {
    const location = useLocation();
    const id = location.pathname.substring(5);

    const {item, setItem} = useState({});

    return (
        <div className="order-wrapper">
            <h1>{item.name}</h1>
            <h1>{item.price}</h1>
        </div>
    )
}

export default Order;
